import { useState, useEffect } from "react";
import axios from "axios";
import { Card, CardContent } from "@/components/ui/card";
import { Table, TableHeader, TableRow, TableHead, TableBody, TableCell } from "@/components/ui/table";
import { Loader2, AlertCircle } from "lucide-react";

export default function PnLReport() {
    const [orders, setOrders] = useState([]);
    const [loading, setLoading] = useState(true);
    const [error, setError] = useState(null);

    useEffect(() => {
        async function fetchPnL() {
            try {
                const response = await axios.get("http://localhost:5000/api/pnl_report");
                setOrders(response.data);
            } catch (err) {
                setError("Failed to load PnL data.");
            } finally {
                setLoading(false);
            }
        }
        fetchPnL();
    }, []);

    return (
        <div className="container mx-auto p-6">
            <h1 className="text-2xl font-bold mb-4">Dummy Order PnL Report</h1>

            <Card>
                <CardContent className="p-4">
                    {loading ? (
                        <div className="flex justify-center items-center">
                            <Loader2 className="animate-spin w-6 h-6 text-blue-500" />
                            <span className="ml-2">Loading PnL data...</span>
                        </div>
                    ) : error ? (
                        <div className="flex items-center text-red-500">
                            <AlertCircle className="w-5 h-5" />
                            <span className="ml-2">{error}</span>
                        </div>
                    ) : (
                        <Table>
                            <TableHeader>
                                <TableRow>
                                    <TableHead>Order ID</TableHead>
                                    <TableHead>Symbol</TableHead>
                                    <TableHead>Buy Price</TableHead>
                                    <TableHead>Live Price</TableHead>
                                    <TableHead>Quantity</TableHead>
                                    <TableHead>PnL</TableHead>
                                    <TableHead>PnL %</TableHead>
                                    <TableHead>Type</TableHead>
                                </TableRow>
                            </TableHeader>
                            <TableBody>
                                {orders.map((order) => (
                                    <TableRow key={order.order_id}>
                                        <TableCell>{order.order_id}</TableCell>
                                        <TableCell>{order.symbol}</TableCell>
                                        <TableCell>${order.buy_price.toFixed(2)}</TableCell>
                                        <TableCell>${order.live_price.toFixed(2)}</TableCell>
                                        <TableCell>{order.quantity}</TableCell>
                                        <TableCell
                                            className={order.unrealized_pnl >= 0 ? "text-green-500" : "text-red-500"}
                                        >
                                            ${order.unrealized_pnl.toFixed(2)}
                                        </TableCell>
                                        <TableCell
                                            className={order.pnl_percentage >= 0 ? "text-green-500" : "text-red-500"}
                                        >
                                            {order.pnl_percentage.toFixed(2)}%
                                        </TableCell>
                                        <TableCell>{order.order_type}</TableCell>
                                    </TableRow>
                                ))}
                            </TableBody>
                        </Table>
                    )}
                </CardContent>
            </Card>
        </div>
    );
}
